insert into translations(key, value, platform, external, "group", created_at, updated_at, deleted_at) VALUES ('или же напишите нам на почту info@halyktravel.kz. При обращении вам необходимо указать номер билета или заказа, номер телефона и email указанные при бронировании, а также маршрут и количество пассажиров.', '{"en":"Or write to us in the mail info@halyktravel.kz. When applying, you need to specify a ticket or order number, phone number and email specified when booking, as well as the route and number of passengers.","kk":"Немесе бізге info@halyktravel.kz поштасында жазыңыз. Қолданған кезде сізге броньдау немесе тапсырыс нөмірін, телефон нөмірін және брондау кезінде көрсетілген, сонымен қатар, брондау кезінде, сондай-ақ жолаушылар саны мен нөмірін көрсету керек.","ru":"или же напишите нам на почту info@halyktravel.kz. При обращении вам необходимо указать номер билета или заказа, номер телефона и email указанные при бронировании, а также маршрут и количество пассажиров."}', 'frontend', false, 'group_2', now(), null, null);
